import './App.css';
import {useState} from 'react'
import Cards from './components/Cards.jsx';
// import characters from './data.js';
import {Container, ContCartas} from './components/styled-components.jsx';
import Nav from './components/Nav';
// import {Routes, Route} from 'react-router-dom';

function App () {

  const [characters, setCharacters] = useState([]);

  function onSearch(){
    const example = {
      name: 'Morty Smith',
      species: 'Human',
      gender: 'Male',
      image: 'https://rickandmortyapi.com/api/character/avatar/2.jpeg',
    };

    setCharacters([example]);
  }

  return (
    <Container className='App' style={{ padding: '25px'}}>
      
      <div>
        
        <Nav
          onSearch={onSearch}
          //navigate(/home)
        />
        
        <hr/>
      

        <hr/>
      </div>
      <ContCartas>
      
      <div>
        <Cards
          characters={characters}
        />
      </div>
     
      </ContCartas>
    </Container>
  )
}

export default App
